import React from 'react';
import PropTypes from 'prop-types';

const NetBase = (props) => {
  const style = {
    fill: '#30abef',
    stroke: '#1a1a1a',
    strokeWidth: '5',
  };

  return (
    <ellipse
      cx={props.position.x}
      cy={props.position.y}
      rx={60}
      ry={20}
      style={style}
    />
    // <ellipse cx = {} cy = {} rx = {} ry = {} style = {fill:'#30abef'}/>
  );
};

NetBase.propTypes = {
  position: PropTypes.shape({
    x: PropTypes.number.isRequired,
    y: PropTypes.number.isRequired,
  }).isRequired,
};

export default NetBase;
